B.Tw=new A.uB("Banda S. Crist\xf3v\xe3o de Rio Tinto",'A Banda S. Crist\xf3v\xe3o de Rio Tinto, nasceu em Janeiro de 1937, sob a reg\xeancia de Jos\xe9 Neves (Saramago), como Banda Nova de Rio Tinto. A Banda Marcial S. Crist\xf3v\xe3o de Rio Tinto tornou-se uma das mais conceituadas Bandas de M\xfasica da \xe9poca, na regi\xe3o Norte do nosso pa\xeds. Em 1971, os associados conseguiram comprar um terreno na Rua de Santa Luzia, para edifica\xe7\xe3o da nova sede da associa\xe7\xe3o (actual edif\xedcio sede), a qual acabou por ser inaugurada em Abril de 1971.\n\nA Banda S. Crist\xf3v\xe3o de Rio Tinto \u2013 designa\xe7\xe3o adoptada em Outubro de 2005 \u2013 faz da m\xfasica uma parte substancial da vida dos seus cerca de 60 m\xfasicos.\n\nReflexo do que melhor sabe fazer, m\xfasica, tem tido convites que permitem \xe0 Banda a sua apresenta\xe7\xe3o, quer cumprindo as suas fun\xe7\xf5es enquanto Banda Filarm\xf3nica nas romarias de todo o pa\xeds e Guardas de Honra a entidades oficiais, quer na participa\xe7\xe3o em Encontros de Bandas, quer, ainda, na organiza\xe7\xe3o regular do seu pr\xf3prio Encontro de Bandas da Cidade de Rio Tinto \u2013 Concertos de Ver\xe3o desde 2006, quer, por fim, ao mais alto n\xedvel, com concertos Corais-Sinf\xf3nicos ou participa\xe7\xf5es em conceituados Festivais.\n\nUm dos expoentes m\xe1ximos da hist\xf3ria recente da Banda foi a participa\xe7\xe3o no \u201cCertamen Internacional de Bandas de M\xfasica \u2013 Ciudad de Valencia\u201d em 2007, um dos mais prestigiados a n\xedvel europeu e a selec\xe7\xe3o desta banda para a participa\xe7\xe3o no 16th World Music Contest de Kerkrade \u2013 Holanda, o mais prestigiado concurso de bandas a n\xedvel mundial, onde foi nomeada banda do dia (2009). Em territ\xf3rio Nacional foi participando em v\xe1rios festivais e encontros de bandas, entre os quais o famoso "Festival de Bandas Filarmonia ao Mais Alto N\xedvel", no qual foi descrita como exibidora de uma \u201catitude serena e segura\u201d durante toda a sua \u201catua\xe7\xe3o de muito bom n\xedvel\u201d, \u201csegura e eficaz\u201d, conseguindo uma \u201cpresta\xe7\xe3o condizente com o seu estatuto de Banda de Qualidade, que tem gosto no que faz!\u201d.\n\nPelas suas Bodas de Diamante, foi agraciada com b\xean\xe7\xe3o papal de Sua Santidade o Papa Bento XVI, tendo sido a primeira banda a receber tal agrado do meio eclesi\xe1stico, e missivas do Exmo. Reverend\xedssimo Bispo do Porto D. Manuel Clemente e do P\xe1roco da freguesia de Rio Tinto, Exmo. Sr. Padre Ant\xf3nio Vidinha. Teve ainda o reconhecimento por parte do Presidente da Rep\xfablica, Exmo. Professor Doutor An\xedbal Cavaco Silva, atrav\xe9s do of\xedcio 01317, datado de 23-02-2012, congratulando esta institui\xe7\xe3o pelo seu trabalho nos seus 75 anos de exist\xeancia.\n\nNo seu 76o Anivers\xe1rio em Janeiro de 2013 recebeu a Medalha de M\xe9rito (Grau Ouro) da C\xe2mara Municipal de Gondomar pelo reconhecido trabalho no \xe2mbito Cultural e Musical, tendo sido tamb\xe9m\n\nagraciada com uma condecora\xe7\xe3o Honrosa por parte da Junta de Freguesia de Rio Tinto, que j\xe1 considerou a BSCRT como o \u201cconservat\xf3rio de M\xfasica\u201d da cidade de Rio Tinto. N\xe3o menos importante foi a carta de reconhecimento \xe0 Banda, enviada pela Sua Alteza Real Dom Duarte de Bragan\xe7a, elogiando o trabalho musical e o associativismo pela BSCRT desenvolvido.\n\nOrganiza anualmente alguns Concertos tem\xe1ticos, como o \u201cConcerto de Natal\u201d, Concerto de Ano Novo\u201d, \u201cConcerto do Dia da M\xe3e\u201d, \u201cConcerto de Anivers\xe1rio\u201d, entre outros.\n\nPossui uma escola de m\xfasica com cerca de 40 alunos, de v\xe1rias idades, com proveni\xeancias de diversos estratos sociais que ensina e incentiva o gosto pela m\xfasica, para al\xe9m de preencher os tempos livres dos jovens e promover a renova\xe7\xe3o cont\xednua da Banda. Assinala-se tamb\xe9m a incr\xedvel ades\xe3o de que a Banda tem sido alvo por parte das camadas mais jovens do concelho, fazendo da sua escola de m\xfasica um elemento fundamental quer na forma\xe7\xe3o desses mesmos jovens, quer no refor\xe7o dos quadros da pr\xf3pria banda cuja m\xe9dia de idades ronda os 23 anos, tornando-os activos v\xe1lidos nesse \xe2mbito.\n\nPossui ainda um Quinteto de Metais \u201cJarms Brass\u201d, um \u201cEnsemble de Saxofones\u201d e uma \u201cOrquestra Juvenil\u201d. Participam em concertos a convite de algumas Associa\xe7\xf5es, Juntas de Freguesia e C\xe2mara Municipal.\n\nPublica trimestralmente a sua Magazine \u201cAbufa na Gaita\u201d que d\xe1 a conhecer a atividade da Associa\xe7\xe3o, bem como algumas curiosidades musicais.\n\nAssume em 2019 a dire\xe7\xe3o mais jovem da hist\xf3ria da BSCRT com uma aposta na moderniza\xe7\xe3o e informatiza\xe7\xe3o da associa\xe7\xe3o, o que se tornou uma mais valia na vitalidade da mesma. Em 2022, por ocasi\xe3o da comemora\xe7\xe3o da Eleva\xe7\xe3o de Rio Tinto a Cidade, a BSCRT foi a entidade coletiva escolhida para ser agraciada com a Medalha de M\xe9rito da Cidade.\n\nV\xe1rios maestros foram passando pela dire\xe7\xe3o da Banda, cada um deixando a sua marca. Atualmente, Rodolfo Maia \xe9, desde Novembro de 2022, o Maestro e Director art\xedstico da Banda S. Crist\xf3v\xe3o de Rio Tinto.',"photo_rio_tinto.jpg",null)
