B.TA=new A.uC("Rodolfo Maia","Rodolfo Maia nasceu na Maia, em Janeiro de 1982.\n\nEstudou Clarinete, Fagote e Saxofone com os professores Luciano Machado, Carlos Canhoto, M\xf3nica Pais, Robert Glassburner, Francisco Ferreira, Jean-Marie Londeix, Arno Bornkamp, Alfonso Padilla e Jacob Ter Veldhuis nos Conservat\xf3rios de M\xfasica da Maia e do Porto e na Escola Superior de M\xfasica e Artes do Espet\xe1culo do Porto.\n\nTocou com a Banda de M\xfasica de Moreira da Maia, Orquestras de Saxofones do Porto e de Jovens M\xfasicos de Ponte de Lima e com os projetos \u201cLets Groove Big band\u201d, \u201cOutbreak\u201d, \u201cGnose\u201d e \u201cGran Morsa\u201d, o quarteto de saxofones \u201cSax4Fun!\u201d, assim como, com a Big Band de Gondomar, Orquestra Ritmos Ligeiros (Trofa), Uni\xe3o Musical Paramense (Espinho), Banda de M\xfasica de Riba D\u2019Ave (V.N. Famalic\xe3o), Banda Musical de Gondomar, Banda de M\xfasica da Cidade de Espinho e com o cantor popular \u201cLu\xeds Manuel\u201d;\n\nIniciou os seus estudos na \xe1rea de dire\xe7\xe3o de banda com o maestro Jacinto Montezo, prosseguindo com os maestros Lu\xeds Clemente, Bert Appermont, Carlos Amarelinho, Paulo Ramos, Jaime Branco, Jacob de Haan, Ant\xf3nio Saiote, Jos\xe9 Ignacio Petit, Jos\xe9 Rafael Pascual Vilaplana, Marcelo Jardim, Jean-Marc Burfin, Hadri\xe1n \xc1vila, Steven Bryant e Verena Moesenbichler-Bryant, tralhando atualmente (desde 2015) com o maestro Paulo Martins, no curso de forma\xe7\xe3o cont\xednua para maestros, da BCA_Band Conducting Academy;\n\nDirigiu a OLB3m - Orquestra Ligeira da Banda de M\xfasica de Moreira da Maia (2008-2010), Banda da Sociedade Filarm\xf3nica Louri\xe7alense \u2013 Pombal (2009), Banda Musical de Cabreiros \u2013 Braga (2010-2014), Tuna Acad\xe9mica do ISMAI_Instituto Superior da Maia (2013), Filarm\xf3nica Ressurrei\xe7\xe3o de Mira (2013-2015), Filarm\xf3nica Verdi Cambrense \u2013 Vouzela,(2017-2022), dirigindo atualmente (desde Novembro de 2022) a Banda S. Crist\xf3v\xe3o de Rio Tinto.\n\nObteve o 2.o Pr\xe9mio no Concurso Nacional de Maestros inserido no Est\xe1gio Nacional da Orquestra de Sopros de Esposende, em 2013; Faz parte da organiza\xe7\xe3o do Concurso Internacional de Bandas CIB \u2013 Filarmonia D\u2019Ouro, desde a sua 1.a edi\xe7\xe3o; e \xe9 membro associado da WASBE \u2013 World Association for Symphonic Bands and Ensembles.\n\nLeciona atualmente as classes de Saxofone nas Escolas de M\xfasica \u201c7 Notas\u201d e \u201cAqui h\xe1 m\xfasica!\u201d Como sax performer faz anima\xe7\xe3o de eventos, agenciado pelas empresas \u201cFunBox\u201d e \u201cDJVox\u201d, para al\xe9m de acompanhar a banda da cantora brasileira Naiara Queiroz;\n\nParalelamente, licenciou \u2013 se em Engenharia Civil pelo Instituto Polit\xe9cnico de Bragan\xe7a, desenvolvendo atualmente a sua atividade profissional na \xe1rea da Ac\xfastica e da Certifica\xe7\xe3o de Edif\xedcios.","photo_maestro_rio_tinto.jpg",null)
